import React from 'react';

const Header = () =>{
    return(
        <nav class="navbar navbar-expand-md navbar-dark bg-dark">
        <div class="mx-auto order-0">
            <a class="navbar-brand mx-auto" href="#">Navbar 2</a>
        </div>

    </nav>
    )
}

export default Header;
